v.x:
var $bm_rt;
var y, x;
y = $bm_sub(thisComp.layer('b').transform.yPosition, thisComp.layer('a').transform.yPosition);
x = $bm_sub(thisComp.layer('b').transform.xPosition, thisComp.layer('a').transform.xPosition);
$bm_rt = $bm_div($bm_mul(Math.atan2(y, x), 180), Math.PI);

var $bm_rt;
var y, x;
y = $bm_sub(thisComp.layer('b').transform.yPosition, thisComp.layer('a').transform.yPosition);
x = $bm_sub(thisComp.layer('b').transform.xPosition, thisComp.layer('a').transform.xPosition);
$bm_rt = $bm_mul($bm_div(Math.sqrt($bm_sum($bm_mul(x, x), $bm_mul(y, y))), 500), 100);
